Lynda.com: Photoshop CS5 Extended One-on-One: 3D Fundamentals

In the first installment of his new Photoshop Extended One-on-One series, Deke McClelland covers the basic techniques for working with 3D in Photoshop, showing how to create textured type and drawing objects that can be manipulated in 3D space. The course covers creating 3D type with moving, scaling, and rotating objects along the X, Y, and Z axes; applying materials to create believable textures; adding realism with lighting, shadows, and contrast; and more. Exercise files are included with the course.

Topics include:

 Creating basic 3D shapes
 Converting 2D art to 3D
 Using the Camera Rotate tool
 Cutting holes from shapes
 Rotating and positioning by the numbers
 Importing a model from Google SketchUp
 Assigning materials and lights
 Setting orientation and position
 Designing a custom bump map
 Modifying the attributes of a material
 Adding a person to a 3D scene

